"""
** ## 无重复字符的最长子串
示例 1:

输入: "abcabcbb"
输出: 3
解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。
示例 2:

输入: "bbbbb"
输出: 1
解释: 因为无重复字符的最长子串是 "b"，所以其长度为 1。
示例 3:

输入: "pwwkew"
输出: 3
解释: 因为无重复字符的最长子串是 "wke"，所以其长度为 3。
     请注意，你的答案必须是 子串 的长度，"pwke" 是一个子序列，不是子串。

分析:https://www.jianshu.com/p/94db35c34fc4
    保存当前字符串list,
    1.如果没有遇到重复的字符,那么可以一直往下增加
    2.如果遇到重复的字符,那么重复的字符x(A/B/N是字符串序列)可能的情况是
        PxAxN(非邻居):f(PxAxN) = max(f(PxA), f(AxN))
        PAxxN(邻居): f(PAxxN) = max(f(PAx), f(xN))
        滑动窗口方式,一个指针指向当前的字符,另一个指针不断往下走,直到第二个指针的字符和第一个指针的字符相同,把第一个指针的字符后移一格
"""


def non_rep_max_string_window(s):
    """
    用滑窗的方式
    :param s: abcabcbb
    :return:
    """
    max_sub_string = []
    occur_char_set = set()

    if len(s) <= 1:
        return len(s)

    i = 0
    j = 0
    occur_char_set = set()
    occur_char_set.add(s[i])
    max_sub_string = [s[i]]

    while True:
        j += 1
        if j >= len(s):  # 字符串遍历结束
            if len(occur_char_set) > len(max_sub_string):
                max_sub_string = s[i:j]
            break

        if s[j] in occur_char_set:  # 碰到相同的字符,i移动找到相同的字符
            if len(occur_char_set) > len(max_sub_string):
                max_sub_string = s[i: j]

            while s[i] != s[j]:
                occur_char_set.remove(s[i])
                i += 1
            # s[i] == s[j]
            # 移动到相同字符的下一个
            i += 1
            if i >= len(s):
                break
            occur_char_set.add(s[j])
        else:
            occur_char_set.add(s[j])

    print(max_sub_string)
    print(len(max_sub_string))
    return len(max_sub_string)


def non_rep_max_string(s):
    """
    时间复杂度过高
    :param s:
    :return:
    """
    max_sub_string = []
    cur_sub_string = []
    occur_char_set = set()

    if len(s) <= 0:
        return 0

    for i in range(len(s)):
        cur_sub_string = []
        occur_char_set = set()
        for j in range(i, len(s)):
            char = s[j]
            if char in occur_char_set:
                if len(cur_sub_string) > len(max_sub_string):
                    max_sub_string = cur_sub_string.copy()
                cur_sub_string = [char]
                occur_char_set.add(char)
            else:
                cur_sub_string.append(char)
                occur_char_set.add(char)

        if len(cur_sub_string) > len(max_sub_string):
            max_sub_string = cur_sub_string.copy()

    print(max_sub_string)
    print(len(max_sub_string))
    return (len(max_sub_string))


