"""
** ## 字符串的排列
给定两个字符串 s1 和 s2，写一个函数来判断 s2 是否包含 s1 的排列。
换句话说，第一个字符串的排列之一是第二个字符串的子串。

示例1:

输入: s1 = "ab" s2 = "eidbaooo"
输出: True
解释: s2 包含 s1 的排列之一 ("ba").

示例2:

输入: s1= "ab" s2 = "eidboaoo"
输出: False

注意：

输入的字符串只包含小写字母
两个字符串的长度都在 [1, 10,000] 之间

分析:
    s2包含s1的排列, 等价于s2中间某一段包含s1的所有字符, 不多也不少
    所以可以用一个计数器来查看当前这段字符串包含的字符数量是否和s1相同
        如果当前字符不在s1中,那么计数器重置,位置指针到达当前字符的下一个字符
        如果当前计数器某个字母的计数为-1,那么计数器重置,位置指针到达第一个该字母的下一个字符
    用滑动窗口解这个问题
"""


def str_rank_contain(s1, s2):
    if s1 is None or s2 is None or len(s1) == 0 or len(s2) == 0:
        return False

    s1_length = len(s1)
    s1_count = {}
    for char in s1:
        if char in s1_count:
            s1_count[char] += 1
        else:
            s1_count[char] = 1

    same_count = 0  # 目前已经相同的字符数量,如果same_count == s1_length, 则返回True
    s1_count_copy = s1_count.copy()

    start_index = 0
    end_index = 0
    while True:
        if end_index >= len(s2):
            return False

        cur_char = s2[end_index]
        if cur_char in s1_count:  # 字符在s1中
            char_count = s1_count_copy[cur_char]
            if char_count >= 1:  # 找到一个相同字符, 计数器-1,看下一个字符
                s1_count_copy[cur_char] -= 1
                end_index += 1

                same_count += 1
                if same_count == s1_length:
                    return True
                if end_index >= len(s2):
                    return False
                continue
            else:  # s1_count_copy[cur_char] <= 0
                while s2[start_index] != cur_char:  # 找到当前字符对应的第一个位置 +1
                    s1_count_copy[s2[start_index]] += 1
                    same_count -= 1
                    start_index += 1
                s1_count_copy[s2[start_index]] += 1
                same_count -= 1
                start_index += 1

        else:  # 字符不在s1中
            start_index = end_index + 1
            end_index += 1
            # 重置
            same_count = 0
            s1_count_copy = s1_count.copy()


def test_str_rank_contain():
    print(str_rank_contain("ab", "eidbaooo"))
    print(str_rank_contain("ab", "eidboaoo"))


"""
** 复原IP地址

给定一个只包含数字的字符串，复原它并返回所有可能的 IP 地址格式。

有效的 IP 地址正好由四个整数（每个整数位于 0 到 255 之间组成），整数之间用 '.' 分隔。

示例:

输入: "25525511135"
输出: ["255.255.11.135", "255.255.111.35"]

分析:设置三个分隔符,分别移动三个分隔符,进行判断, 按照321进行指针移动
"""


def restore_ip_address(s):
    ip_address_list = []
    len_s = len(s)

    for index_a in range(1, len_s - 2):
        a_part = int(s[0:index_a])
        if a_part > 255:
            break

        for index_b in range(index_a + 1, len_s - 1):
            b_part = int(s[index_a: index_b])
            if b_part > 255:
                break

            for index_c in range(index_b + 1, len_s):
                c_part = int(s[index_b: index_c])
                if c_part > 255:
                    break
                d_part = int(s[index_c:])

                if a_part <= 255 and b_part <= 255 and c_part <= 255 and d_part <= 255:
                    if len(str(a_part)) + len(str(b_part)) + len(str(c_part)) + len(str(d_part)) != len_s:
                        # print("error:{}.{}.{}.{}".format(a_part, b_part, c_part, d_part))
                        continue

                    ip_address_list.append("{}.{}.{}.{}".format(a_part, b_part, c_part, d_part))
                    print(ip_address_list)
    return ip_address_list


def test_restore_ip_address():
    restore_ip_address("25525511135")
    restore_ip_address("0000")
    # 注意两个0在一起
    restore_ip_address("010010")
    # 注意超时
    restore_ip_address(
        "")


"""
** ## 字符串相乘
给定两个以字符串形式表示的非负整数 num1 和 num2，返回 num1 和 num2 的乘积，它们的乘积也表示为字符串形式。

示例 1:

输入: num1 = "2", num2 = "3"
输出: "6"
示例 2:

输入: num1 = "123", num2 = "456"
输出: "56088"
说明：

num1 和 num2 的长度小于110。
num1 和 num2 只包含数字 0-9。
num1 和 num2 均不以零开头，除非是数字 0 本身。
不能使用任何标准库的大数类型（比如 BigInteger）或直接将输入转换为整数来处理。

分析:把num2拆成单个数字,和num1相乘,最后求和,单个数字的相乘只要保留余数和进位数即可
"""


def str_multiply(num1, num2):
    if num1 == '0' or num2 == '0':
        return '0'

    result_list = []
    max_length = 0

    for index in range(len(num2)):
        append_zeros_num = len(num2) - index - 1  # 后面加0个数
        cur_char_2 = int(num2[index])

        jinweishu = 0
        cur_result = []
        for i in range(len(num1)):
            cur_char_1 = int(num1[len(num1) - i - 1])
            multi_result = cur_char_1 * cur_char_2 + jinweishu
            jinweishu = multi_result // 10
            yushu = str(multi_result % 10)
            cur_result.insert(0, yushu)
        if jinweishu > 0:
            cur_result.insert(0, str(jinweishu))
        for _ in range(append_zeros_num):
            cur_result.append("0")

        result_list.append(cur_result)
        if len(cur_result) > max_length:
            max_length = len(cur_result)
    print(result_list)

    final_result = []
    jinweishu = 0
    for i in range(max_length):
        sum_tmp = jinweishu
        for list_tmp in result_list:
            if len(list_tmp) > i:
                sum_tmp += int(list_tmp[-(i + 1)])
        jinweishu = sum_tmp // 10
        yushu = sum_tmp % 10
        final_result.insert(0, str(yushu))

    if jinweishu > 0:
        final_result.insert(0, str(jinweishu))

    return "".join(final_result)


def test_str_multiply():
    print(str_multiply("2", "3"))
    print(str_multiply("803", "456"))


"""
## 最长公共前缀
编写一个函数来查找字符串数组中的最长公共前缀。

如果不存在公共前缀，返回空字符串 ""。

示例 1:

输入: ["flower","flow","flight"]
输出: "fl"
示例 2:

输入: ["dog","racecar","car"]
输出: ""
解释: 输入不存在公共前缀。
说明:

所有输入只包含小写字母 a-z 。
"""


def longest_common_prefix(strs):
    if strs is None or len(strs) <= 0:
        return ""
    len_list = [len(str) for str in strs]
    min_len = min(len_list)
    longest_prefix = ""

    for i in range(min_len):
        cur_char_list = [str[i] for str in strs]
        cur_char_set = set(cur_char_list)
        if len(cur_char_set) > 1:  # 出现不同
            return longest_prefix
        else:  # 都相同
            longest_prefix += cur_char_list[0]
    return longest_prefix


def test_longest_common_prefix():
    print(longest_common_prefix(["flower", "flow", "flight"]))
    print(longest_common_prefix(["dog", "racecar", "car"]))


"""
## 翻转字符串里的单词
示例 1：

输入: "the sky is blue"
输出: "blue is sky the"
示例 2：

输入: "  hello world!  "
输出: "world! hello"
解释: 输入字符串可以在前面或者后面包含多余的空格，但是反转后的字符不能包括。
示例 3：

输入: "a good   example"
输出: "example good a"
解释: 如果两个单词间有多余的空格，将反转后单词间的空格减少到只含一个。


说明：

无空格字符构成一个单词。
输入字符串可以在前面或者后面包含多余的空格，但是反转后的字符不能包括。
如果两个单词间有多余的空格，将反转后单词间的空格减少到只含一个。
"""


def reverse_words(s):
    if s is None:
        return None

    s = s.strip()
    if len(s) <= 0:
        return ""

    words = s.split(' ')
    result = []
    for word in words:
        word = word.strip()
        if len(word) <= 0:
            continue
        else:
            result.insert(0, word)
    return " ".join(result)


def test_reverse_words():
    print(reverse_words("the sky is blue"))
    print(reverse_words("  hello world!  "))
    print(reverse_words("a good   example"))


